//SPDX-License-Identifier:MIT
pragma solidity^0.8.0;

contract HakDenial{
    
    address owner;
    constructor()  {
        owner = msg.sender;
    }

    modifier is_owner(){
        require(msg.sender==owner);
        _;
    }
    function kill (address payable _addr)is_owner() public payable {
        selfdestruct(_addr);
    }
}

